import React from 'react';
import MainTitle from "../../components/MainTitle/MainTitle";
import { Swiper, SwiperSlide } from 'swiper/react';
import { Autoplay, Pagination, Navigation } from 'swiper/modules';
import { CardIcon2, CardIcon3, CardIcon4 } from "../../assets/icons";
import Card from "../../components/Card/Card";
import CardImg9 from "../../assets/images/cardImg9.jpg";
import CardImg10 from "../../assets/images/cardImg10.jpg";
import CardImg11 from "../../assets/images/cardImg11.jpg";
import CardImg12 from "../../assets/images/cardImg12.jpg";
import CardImg13 from "../../assets/images/cardImg13.jpg";
import CardImg14 from "../../assets/images/cardImg14.jpg";

import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/css/navigation';

import "./VisaSupport.scss";

const data = [
    {
        id: 0,
        image: CardImg9,
        cityName: "Istanbul",
        users: "234",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            },
        ]
    },

    {
        id: 1,
        image: CardImg10,
        cityName: "Dubai",
        users: "300",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            }
        ]
    },

    {
        id: 2,
        image: CardImg11,
        cityName: "Antalya",
        users: "500",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            }
        ]
    },
    {
        id: 3,
        image: CardImg12,
        cityName: "Sharm El-Sheikh",
        users: "200",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            }
        ]
    },

    {
        id: 4,
        image: CardImg13,
        cityName: "USA",
        users: "400",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            }
        ]
    },

    {
        id: 5,
        image: CardImg14,
        cityName: "England",
        users: "234",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            }
        ]
    },

    {
        id: 6,
        image: CardImg15,
        cityName: "Canada",
        users: "345",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            }
        ]
    },

    {
        id: 7,
        image: CardImg1,
        cityName: "European Union",
        users: "345",
        items: [
            {
                icon: <CardIcon2 />,
                text: "5 Days Trip > Hotel Included"
            },

            {
                icon: <CardIcon3 />,
                text: "Airplane Bill Included"
            },

            {
                icon: <CardIcon4 />,
                text: "Daily Places Visit"
            }
        ]
    },
];

const VisaSupport = () => {
    return (
        <div className="VisaSupport">
            <MainTitle
                title="Visa support"
                text="Experience stress-free travel with our expert visa support. 
                We provide seamless assistance and comprehensive guidance, ensuring a smooth journey."
            />

            <Swiper
                slidesPerView={3}
                spaceBetween={100}
                loop={true}
                // autoplay={{
                //     delay: 1300,
                //     pauseOnMouseEnter: true,
                // }}
                // navigation={true}
                breakpoints={{
                    640: {
                        slidesPerView: 2,
                        spaceBetween: 20,
                    },
                    768: {
                        slidesPerView: 4,
                        spaceBetween: 40,
                    },
                    1024: {
                        slidesPerView: 5,
                        spaceBetween: 50,
                    },
                }}
                modules={[Autoplay, Pagination, Navigation]}
                className="mySwiper"
            >
                {
                    data.map(el => (
                        <SwiperSlide>
                            <Card
                                image={el.image}
                                key={el.id}
                                icon={el.icon}
                                price={el.price}
                                cityName={el.cityName}
                                users={el.users}
                                items={[...el.items]}
                            />
                        </SwiperSlide>
                    ))
                }
            </Swiper>
        </div>
    )
}

export default VisaSupport;
